最後に以下のようなコードで処理結果が等しくなっていることを確認しておきます。 実行結果がtrueと表示されればすべて等しいです。 import java.util.* const val N: Int = 100000
const val M: Int = 10000
fun main() { val originalList = (1..101000).toList() // サイズNのリスト val list = originalList.shuffled().take(N).toMutableList() val naiveResult = naive(list.toMutableList()) val mapResult = map(list) val priorityQueueResult = priorityQueue(list) println(naiveResult == mapResult &amp;&amp; mapResult == priorityQueueResult)
} fun naive(list: MutableList&lt;Int&gt;): List&lt;Int&gt; { repeat(M) { val min = list.minOrNull()!! val index = list.indexOf(min) list[index] = min * 2 } list.sort() return list
} fun map(list: List&lt;Int&gt;): List&lt;Int&gt; { val map = list.groupingBy { it }.eachCount().toSortedMap() // key: 要素の値, value: 個数 repeat(M) { val minElement = map.asSequence().first() // 先頭の要素 = 最小値 val min = minElement.key map[min] = minElement.value - 1 if (map[min] == 0) { map.remove(min) } map[min * 2] = map.getOrDefault(min * 2, 0) + 1 } val result = map.map { (key, value) -&gt; List&lt;Int&gt;(value, { key }) }.flatten().toList() return result
} fun priorityQueue(list: List&lt;Int&gt;): List&lt;Int&gt; { val priorityQueue = PriorityQueue(list) repeat(M) { val min = priorityQueue.poll() priorityQueue.add(min * 2) } val result = priorityQueue.toMutableList() result.sort() return result
}

